import logo from "../img/logo.png";
//import Underline from "./Underline";
//import { useState } from "react";
import { Link, NavLink } from "react-router-dom";

function Header() {
  /*const [hoverTarget, setHoverTarget] = useState(null);

  const hoverHandler = (e) => {
    setHoverTarget(e.target);
  };*/

  return (
    <div className="Header">
      <div className="logo_div">
        <Link href="/">
          <img className="logo_img" src={logo} alt=""></img>
        </Link>
      </div>
      <ul>
        <li>
          <NavLink href="/introduction">회사소개</NavLink>
        </li>
        <li>
          <NavLink to="/programs">프로그램</NavLink>
        </li>
        <li>
          <NavLink to="/lesson">레슨문의</NavLink>
        </li>
        <li>
          <NavLink href="/branch">지사개설</NavLink>
        </li>
        <li>
          <NavLink href="/teacher">교사지원</NavLink>
        </li>
        <li>
          <NavLink href="/community">커뮤니티</NavLink>
        </li>
      </ul>
    </div>
  );
}

export default Header;
